import React, { useState, useRef } from 'react';

interface LoginProps {
  onLoginSuccess: (username: string) => void;
}

const Login: React.FC<LoginProps> = ({ onLoginSuccess }) => {
  const [username, setUsername] = useState('');
  const [randomDigits, setRandomDigits] = useState('');
  const [isRecording, setIsRecording] = useState(false);
  const [recordingTime, setRecordingTime] = useState(0);
  const [verificationResult, setVerificationResult] = useState<string | null>(null);
  const [isVerifying, setIsVerifying] = useState(false);
  const timerRef = useRef<number | null>(null);

  const generateRandomDigits = () => {
    let digits = '';
    for (let i = 0; i < 8; i++) {
      digits += Math.floor(Math.random() * 10);
    }
    return digits;
  };

  const handleStart = () => {
    if (!username) {
      alert('请输入用户名');
      return;
    }
    
    setRandomDigits(generateRandomDigits());
    setIsRecording(true);
    setRecordingTime(0);
    setVerificationResult(null);
    
    // 模拟录音计时
    timerRef.current = window.setInterval(() => {
      setRecordingTime(prev => prev + 1);
    }, 1000);
  };

  const handleStop = () => {
    if (timerRef.current) {
      clearInterval(timerRef.current);
      timerRef.current = null;
    }
    
    setIsRecording(false);
    setIsVerifying(true);
    
    // 模拟验证过程
    setTimeout(() => {
      setIsVerifying(false);
      
      // 随机模拟三种验证结果
      const result = Math.floor(Math.random() * 3);
      if (result === 0) {
        setVerificationResult('success');
        setTimeout(() => onLoginSuccess(username), 1500);
      } else if (result === 1) {
        setVerificationResult('fail');
      } else {
        setVerificationResult('fake');
      }
    }, 2000);
  };

  return (
    <div className="space-y-4">
      <div className="space-y-2">
        <label className="block text-sm font-medium text-gray-700">用户名</label>
        <input
          type="text"
          className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          disabled={isRecording || isVerifying}
        />
      </div>
      
      {randomDigits && (
        <div className="p-4 bg-gray-100 rounded-lg text-center">
          <p className="text-lg font-medium">请朗读以下数字：</p>
          <p className="text-3xl font-bold tracking-wider my-2">{randomDigits}</p>
        </div>
      )}
      
      {isRecording && (
        <div className="text-center">
          <div className="inline-block px-3 py-1 rounded-full bg-red-500 text-white animate-pulse">
            录音中...{recordingTime}秒
          </div>
        </div>
      )}
      
      {isVerifying && (
        <div className="text-center">
          <div className="inline-block px-3 py-1 rounded-full bg-yellow-500 text-white">
            验证中...
          </div>
        </div>
      )}
      
      {verificationResult === 'success' && (
        <div className="p-3 bg-green-100 text-green-700 rounded-lg text-center">
          声纹验证成功，登录中...
        </div>
      )}
      
      {verificationResult === 'fail' && (
        <div className="p-3 bg-red-100 text-red-700 rounded-lg text-center">
          声纹验证失败，非本人声音！
        </div>
      )}
      
      {verificationResult === 'fake' && (
        <div className="p-3 bg-orange-100 text-orange-700 rounded-lg text-center">
          检测到伪装语音，登录失败！
        </div>
      )}
      
      <div className="flex space-x-4">
        {!isRecording ? (
          <button
            className="w-full py-2 px-4 bg-blue-500 text-white rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500 disabled:bg-blue-300"
            onClick={handleStart}
            disabled={isVerifying || !username}
          >
            开始录音
          </button>
        ) : (
          <button
            className="w-full py-2 px-4 bg-red-500 text-white rounded-md hover:bg-red-600 focus:outline-none focus:ring-2 focus:ring-red-500"
            onClick={handleStop}
          >
            停止录音
          </button>
        )}
      </div>
    </div>
  );
};

export default Login;
